(113, '[10277960]Trần Khắc Chân, Tân Định, Quận 1, Hồ Chí Minh', 'Bán nhà mặt tiền Trần Khắc Chân, P. Tân Định, Quận 1, DT: 4.04x11.2m, 1 tầng, giá 14.5 tỷ Bán nhà mặt tiền Trần Khắc Chân, p. Tân Định, quận 1. Diện tích 4.04 x 11.2m Kết cấu 1 trệt 1 lầu, nhà mới dọn vào ở ngay - Vị trí:Tuyến đường rộng rãi thoáng mát. Khu vực xung quanh đầy đủ tiện ích từ trường học, bệnh viện, siêu thị đến trung tâm mua sắm. Đồng thời khu vực xung quanh nhiều building, văn phòng, Khu vực vip nhất Quận. - Pháp lý đầy đủ, sổ hồng chính chủ công chứng. Sang tên trong ngày. - Giá', 14500000000, 45, 'Trần Khắc Chân, Tân Định', 'S', 1, 81, 'A', '2022-06-07 07:37:01', '2022-06-07 07:37:01'),
(114, '[9514528]Trần Quý Khoách, Tân Định, Quận 1, Hồ Chí Minh', '- Cần bán nhà 2 mặt tiền Trần Quý Khoách, Tân Định, Quận 1 - DT: 8x17m - KC: hầm 5 lầu - Vị trí: khu vực tập trung nhiều văn phòng, spa, trường học.. - Phù hợp làm văn phòng công ty, spa, căn hộ cho thuê.... - Giá chỉ 51 tỷ - LH: 0925 288 6990925 28xxx click để xem Lê Đức Xem thêm', 51000000000, 136, 'Trần Quý Khoách, Tân Định', 'S', 1, 82, 'A', '2022-06-07 07:37:01', '2022-06-07 07:37:01'),
(115, '[9708063]Trần Quý Khoách, Tân Định, Quận 1, Hồ Chí Minh', 'Trần Quý Khoách, P. Tân Định Quận 1. DTKV: 128m2 (8m x 16m) - KC: Trệt 5 lầu ST thang máy cao cấp hoàn công đầy đủ. - Nhà có 019 phòng đến cuối năm 2020 hoàn thành xong. - DT Phòng: 14m2 - 25m2 - 40m2 full view cực đẹp. - Giá 55 tỷ giảm còn 52 tỷ.', 55000000000, 128, 'Trần Quý Khoách, Tân Định', 'S', 1, 83, 'A', '2022-06-07 07:37:02', '2022-06-07 07:37:02'),
(116, '[10253555]Trần Quý Khoách, Tân Định, Quận 1, Hồ Chí Minh', '- Vị trí đắc địa đường cực đẹp đường Trần Quý Khoách P.Tân Định Quận 1. khu vực Kinh Doanh Văn Phòng và Khách sạn . Khu vực tập trung rất nhiều khách du lịch nước ngoài đến tham quan du lịch, khu phố hoạt động 24/24 kinh doanh đa ngành nghề. Rất thích hợp để Kinh Doanh Nhà Hàng Khách Sạn, mang lại lợi nhuận rất cao. Bán nhà 8 Trần Quý Khoách Tân Định Quận 1 -Diện tích: 14x26 có GPXD 2 Hầm, 12L', 120000000000, 364, 'Trần Quý Khoách, Tân Định', 'S', 1, 84, 'A', '2022-06-07 07:37:02', '2022-06-07 07:37:02'),
(117, '[10179058]Trần Khánh Dư, Tân Định, Quận 1, Hồ Chí Minh', 'Bán căn nhà đường Trần Khánh Dư, Tân Định, Quận 1. Diện tích 4x12m. Kết cấu: 1 trệt 2 lầu. Nhà mới xây có 5 phòng ngủ, 5 WC. Có hợp đồng thuê 30 triệu /tháng. Vị trí nhà nằm ngay trung tâm thành phố, khu vực cực kì sầm uất, xung quanh là đầy đủ tiện ích như trường học, chợ, bệnh viện. Khu vực an ninh cao. Thích hợp mua để ở hoặc đầu tư sinh lời. Giá bán 15 tỷ. Pháp lý rõ ràng, sổ hồng chính chủ. Ai có nhu cầu liên hệ (Minh Đức).', 15000000000, 48, 'Trần Khánh Dư, Tân Định', 'S', 1, 85, 'A', '2022-06-07 07:37:02', '2022-06-07 07:37:02'),
(118, '[10342730]Trần Khánh Dư, Tân Định, Quận 1, Hồ Chí Minh', 'Gia đình cần tiền bán nhanh trước tết giảm ngay 6 tỷ cho chủ nhân sở hữu tòa nhà 1 hầm 7 tầng xây dựng vuông vức 4,15mx30m, thang máy nội thất cáo cấp, giấy tờ chính chủ cá nhân mua bán nhanh. Xem nhà hãy gọi 0919799090 em Tân.', 39500000000, 125, 'Trần Khánh Dư, Tân Định', 'S', 1, 86, 'A', '2022-06-07 07:37:02', '2022-06-07 07:37:02'),
(119, '[10163819]Đặng Dung, Tân Định, Quận 1, Hồ Chí Minh', 'Cần tiền bán nhà mặt tiền Đặng Dung, Quận 1. - Diện tích: 7x24m. - Kết cấu: Trệt 2 lầu. - Vị trí: Khu vực sang trọng, văn minh. - Pháp lý: Sổ hồng. - Giá: 46 tỷ tl. - Liên hệ xem nhà: 0925 288 699 Lê Đức.', 48000000000, 168, 'Đặng Dung, Tân Định', 'S', 1, 87, 'A', '2022-06-07 07:37:02', '2022-06-07 07:37:02'),
(120, '[10261980]Đặng Dung, Tân Định, Quận 1, Hồ Chí Minh', 'Định cư nước ngoài cần bán gấp căn đường Đặng Dung quận 1 8x18m 6 tầng. Nhà nằm khu vực kinh doanh sầm uất các ngành spa, văn phòng công ty, cafe, vị trí tốt khu trung tâm. Diện tích 8x18m gồm hầm và 6 tầng đang có hợp đồng thuê 120tr. Giá 51.5 tỷ thương lượng cho khách thiện chí. Liên hệ Sơn để xem nhà trực tiếp và tư vấn các sản phẩm tốt nhất thị trường.', 51500000000, 144, 'Đặng Dung, Tân Định', 'S', 1, 88, 'A', '2022-06-07 07:37:02', '2022-06-07 07:37:02'),
(121, '[9551690]Nguyễn Văn Nguyễn, null, Quận 1, Hồ Chí Minh', '***Bán nhà MT cực VIP Nguyễn Văn Nguyễn Quận 1 - Vị trí vàng, thuận tiện cho mọi hoạt động và di chuyển tới các khu vực trung tâm thành phố. - Làm nơi ở rất tốt, điều kiện xung quanh rất tốt, có đầy đủ tiện ích (nhà hàng, quán ăn, cửa hàng tiện lợi, ngân hàng, công viên) phục vụ cho việc ở, ăn uống, sinh hoạt cho cá nhân sống cuộc sống hiện đại và tiện lợi. - Tổng diện tích 82m2, 1 trệt, 4 lầu, 1 sân thượng - Khuôn đất: 4x23 m - Giá: 28 tỷ, CÒN BỚT CHÚT LỘC CHO KHÁCH MUA CÓ THIỆN CHÍ - Sinh lợi ', 28000000000, 82, 'Nguyễn Văn Nguyễn, null', 'S', 1, 89, 'A', '2022-06-07 07:37:02', '2022-06-07 07:37:02'),
(122, '[9552061]Trần Khắc Chân, Tân Định, Quận 1, Hồ Chí Minh', 'Bán nhà mặt tiền 52 Trần Khắc Chân- P.Tân Định Q1. -Diện tích:4.7x11.2m, - Kết cấu :3 lầu sân thượng . -Vị trí :Khu vực tập trung kinh doanh buôn bán sầm uất,thích hợp để ở, cho thuê VP công ty hoặc spa... -Giá bán: 25 tỷ thương lượng. Liênhệ : 0915.151.7810915.15xxx click để xem Bá Nghiệp. Xem thêm', 25000000000, 53, 'Trần Khắc Chân, Tân Định', 'S', 1, 90, 'A', '2022-06-07 07:37:02', '2022-06-07 07:37:02'),
(123, '[10038885]Trần Khắc Chân, Tân Định, Quận 1, Hồ Chí Minh', 'Cần bán gấp nhà 2 mặt tiền Trần Khắc Chân p. Tân Định quận 1. Diện tích: 4 x 10m. Kết cấu: 3 tầng. Giá 16,8 tỷ. Vị trí: Nhà góc 2 mặt tiền đoạn đẹp nhất Trần Khắc Chân quận 1, khu kinh doanh sầm uất đa ngành nghề. Xung quanh đầy đủ tiện ích: Chợ, trường học, nhà hàng, cafe... Sổ hồng chính chủ, mua bán nhanh. Liên hệ chính chủ 0909441302 để xem nhà và sổ hồng trực tiếp.', 16800000000, 40, 'Trần Khắc Chân, Tân Định', 'S', 1, 91, 'A', '2022-06-07 07:37:03', '2022-06-07 07:37:03'),
