(326, '[8235284]Trần Khắc Chân, Tân Định, Quận 1, Hồ Chí Minh', 'Nhà bán chính chủ căn góc 2 mặt tiền đường Trần Khắc Chân, phường Tân Định, quận 1. Diện tích: Ngang 4m x 8m 30m2. Vị trí siêu đẹp, góc 2 mặt tiền Trần Khắc Chân rất đắc địa, khu vực kinh doanh sầm uất, giao thông thuận lợi, tập trung nhiều tòa nhà văn phòng, ngân hàng, nhà hàng, Spa cao cấp, rất lý tưởng để ở hoặc kinh doanh đa ngành nghề. Giá bán 12.9 tỷ. Liên Hệ: Phúc Cung cấp thông tin chính xác và nhiều căn nhà tương tự.', 12900000000, 30, 'Trần Khắc Chân, Tân Định', 'L', 1, 161, 'A', '2022-06-07 07:43:02', '2022-06-07 07:43:02'),
(327, '[8390650]Trần Khắc Chân, Tân Định, Quận 1, Hồ Chí Minh', 'Chính chủ bán nhà MT Trần Khắc Chân, P. Tân Định, Q. 1. - DT: 12x33m. Vuông vức. - Công nhận: 400m2. - GPXD: 2 hầm 8 lầu. - Sổ hồng công chứng trong ngày. - Giá 160 tỷ. - Liên hệ: Quốc Anh ĐàLạt 0931133966.', 160000000000, 396, 'Trần Khắc Chân, Tân Định', 'L', 1, 162, 'A', '2022-06-07 07:43:02', '2022-06-07 07:43:02'),
(328, '[7527470]Trần Khánh Dư, Tân Định, Quận 1, Hồ Chí Minh', 'Chính chủ bán nhà MT Trần Khánh Dư, Phường Tân Định, Quận 1: - Vị trí trung tâm Quận 1, giao thông thuận tiện, liền kề Quận 3, Quận 4, Quận 2, Quận Bình Thạnh, Quận 5. - Khu vực văn phòng, dân trí cao, thông Hoàng Sa. - Diện tích: 4.2mx11m. - Nội thất cao cấp Châu Âu, đẳng cấp, sang trọng. - Nhà đang ở chưa qua đầu tư. - Giá bán tốt nhất khu vực: 13.5 tỷ thương lượng. - Gọi ngay: 0914 88 7970 (Mr Huy - Chuyên gia bất động sản trung tâm). Thông tin pháp lý: Sổ hồng chính chủ.', 13500000000, 46, 'Trần Khánh Dư, Tân Định', 'L', 1, 170, 'A', '2022-06-07 07:43:06', '2022-06-07 07:43:06'),
(329, '[7502361]Đặng Dung, null, Quận 1, Hồ Chí Minh', '\"Bán gấp Nhà GIÁ TỐT 6,2x28m 7 Tầng MT 55 Đặng Dung Q1 60 tỷ - Khu Vực sang trọng, sạch sẽ, Người nước ngoài sinh sống, rất an ninh - Giá rẻ 60 tỷ - DT 6,2x28 m - Kết Cấu: 7 Tầng - Đầu tư sinh lợi ngay. Xe hơi quay đầu thoải mái, nay cần tiền cho con đi du học nước ngoài nên cần bán gấp - Sổ hồng chính chủ, pháp lý đầy đủ. Gọi ngay để được tư vấn chi tiết. Giá rẻ cho khách cần mua nhà - --- Liên Hệ: 0917.918.184 A Toàn --- Chuyên Gia Pháp Lý BDS \"\"Làm Đúng, Mua Đúng, Bán Đúng\"\" ---\"', 60000000000, 174, 'Đặng Dung, null', 'L', 1, 171, 'A', '2022-06-07 07:43:06', '2022-06-07 07:43:06'),
(330, '[7642891]Nguyễn Văn Nguyễn, null, Quận 1, Hồ Chí Minh', '\"Bán Nhà MT TỐT nhất 14 Nguyễn Văn Nguyễn Q1 giá 32 tỷ 4x25m 5 Tầng Đây là căn nhà giá tốt tại thời điểm hiện tại, rất khó tìm được căn thứ 2. Cơ hội chỉ đến với ai biết nắm bắt - Mặt tiền ngang: 4x25 m - Nhà: 5 Tầng Pháp lý sổ hồng chính chủ. Công chứng trong ngày - Giá: 32 tỷ --- Liên Hệ: 0917.918.184 A Toàn --- Chuyên Gia Pháp Lý BDS \"\"Làm Đúng, Mua Đúng, Bán Đúng\"\" ---\"', 32000000000, 100, 'Nguyễn Văn Nguyễn, null', 'L', 1, 172, 'A', '2022-06-07 07:43:09', '2022-06-07 07:43:09'),
(331, '[7153981]Trần Khắc Chân, Tân Định, Quận 1, Hồ Chí Minh', 'Bất Động Sản (Đã bán)Bán căn nhà 2 Mặt tiền Trần Khắc Chân P Tân Định Q1 13.500.000.000 ₫ Thanh Pho Ho Chi Minh Bán căn nhà 2 Mặt tiền Trần Khắc Chân P Tân Định Q1 Dt 4,2x8 kết cấu 1 trệt 2 lầu, Vị Trí kinh doanh mọi ngành nghề. LH 0961986456 - 0937784575 14 giờ · Công khai Lưu · Xem thêm', 13500000000, 34, 'Trần Khắc Chân, Tân Định', 'L', 1, 173, 'A', '2022-06-07 07:43:09', '2022-06-07 07:43:09'),
(332, '[6689478]Trần Quý Khoách, Tân Định, Quận 1, Hồ Chí Minh', '- Gia đình cần bán căn nhà 2 mặt tiền trần quý khoách , phường tân định ,quận 1. - diện tích 177m2 ( ngang hơn 8m x dài hơn 20m ) - Nhà cấp 4, tiện xây mới - giá bán 57 tỷ có thương lượng . - ko tiếp mô giới .', 57000000000, 177, 'Trần Quý Khoách, Tân Định', 'L', 1, 174, 'A', '2022-06-07 07:43:12', '2022-06-07 07:43:12'),
(333, '[9175139]Trần Khánh Dư, Tân Định, Quận 1, Hồ Chí Minh', 'Bán nhà nát mặt tiền 41A Trần Khánh Dư, Quận 1, nở hậu. - Diện tích 4x15m. - Hiện trạng nhà cấp 4. - Pháp lý: Công chứng ngay. -------------------------------- + Giá bán: 17 tỷ TL. + Liên hệ: Văn Đô. --------------------------------- + Website: Trumdoo.com + Kênh Youtube: Trum doo. + Hiện nắm trên 5000 sản phẩm nhà mặt phố sổ hồng riêng tại các quận trung tâm TP HCM, tiềm năng tăng giá cao, thanh khoản tốt, có hợp đồng cho thuê giá trị. + Nhận tìm nhà mua theo nhu cầu với thời gian nhanh nhất. +', 17000000000, 60, 'Trần Khánh Dư, Tân Định', 'L', 1, 175, 'A', '2022-06-07 07:43:12', '2022-06-07 07:43:12'),
