(335, '[6178889]Trần Quý Khoách, null, Quận 1, Hồ Chí Minh', 'Bán nhà mặt tiền đường Trần Quý Khoách, Quận 1. Diện tích: 8x14m, vuông vức, phong thủy đẹp, 1 hầm, 4 lầu, thang máy. Hiện đang cho thuê 90 triệu/tháng. Pháp lý: Sổ hồng chính chủ, công chứng mua bán trong ngày. Vị trí rất đắc địa, khu vip tập trung nhiều biệt thự sang trọng, dân trí cao, an ninh, cao ốc văn phòng, thẩm mỹ viện, căn hộ dịch vụ cao cấp. Giá bán 36,5 tỷ TL Xem nhà liên hệ chính chủ: 0937487419- Hải An (Zalo. Viber 24/7)', 36500000000, 112, 'Trần Quý Khoách, null', 'L', 1, 177, 'A', '2022-06-07 07:43:15', '2022-06-07 07:43:15'),
