(337, '[6487684]Trần Khắc Chân, Tân Định, Quận 1, Hồ Chí Minh', 'Tôi chính chủ gửi bán căn nhà mặt tiền Trần Khắc Chân Quận 1. Diện tích: 3.5x12m. Xây dựng: 1 trệt 2 lầu. Vị trí căn nhà cực kỳ đẹp ngay mặt tiền trần khắc chân quận 1. Nơi kinh doanh sầm uất và đang có hợp đồng thuê cao, giá trị căn nhà còn tăng cao nữa. Mọi chi tiết liên hệ: 0909504998. Thông tin pháp lý: Sổ hồng', 18000000000, 42, 'Trần Khắc Chân, Tân Định', 'L', 1, 179, 'A', '2022-06-07 07:43:16', '2022-06-07 07:43:16'),
(338, '[10277960]Trần Khắc Chân, Tân Định, Quận 1, Hồ Chí Minh', 'Bán nhà mặt tiền Trần Khắc Chân, P. Tân Định, Quận 1, DT: 4.04x11.2m, 1 tầng, giá 14.5 tỷ Bán nhà mặt tiền Trần Khắc Chân, p. Tân Định, quận 1. Diện tích 4.04 x 11.2m Kết cấu 1 trệt 1 lầu, nhà mới dọn vào ở ngay - Vị trí:Tuyến đường rộng rãi thoáng mát. Khu vực xung quanh đầy đủ tiện ích từ trường học, bệnh viện, siêu thị đến trung tâm mua sắm. Đồng thời khu vực xung quanh nhiều building, văn phòng, Khu vực vip nhất Quận. - Pháp lý đầy đủ, sổ hồng chính chủ công chứng. Sang tên trong ngày. - Giá', 14500000000, 45, 'Trần Khắc Chân, Tân Định', 'L', 1, 81, 'A', '2022-06-07 07:43:19', '2022-06-07 07:43:19');
